import './style.css';
import Jumbotron from './react-bootstrap/Jumbotron'

function Home() {
    return (
        <>
            <Jumbotron>
                <div className="media">
                    <h3>Amy Moseman</h3>
                    <img src="../../assets/IMG_1911.jpg"></img>





                </div>
            </Jumbotron>
        </>
    );
}

export default Home;
